const UserImage = require("../models/UserImage");

class ImageService {
  async ensureDefaultImageExists() {
    try {
      const defaultImage = await UserImage.findOne({ filename: "default.jpg" });

      if (!defaultImage) {
        const newDefaultImage = new UserImage({
          filename: "default.jpg",
          contentType: "image/jpeg",
          imageBase64: "",
        });

        await newDefaultImage.save();
        return newDefaultImage._id;
      }

      return defaultImage._id;
    } catch (error) {
      console.error("Error ensuring default image exists:", error);
      throw error;
    }
  }
}

module.exports = new ImageService();
